@mixin clearfix {
    &::after {
        content: "";
        display: table;
        clear: both;
    }
}

@mixin absCenter {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
}
// MEDIA QUERY MANAGER
/*
0 - 320px: IPhone4
0 - 360px: Galaxy5
0 - 768px:  Phone
768 - 1024px: Tablet port
1024-1440px; PC port (Desktop)
/*
@breakpoint arguement choices:
- iphone4
-galaxy5
- phone
- tablet
- desktop 
1em = 16px (12 font size Office word);
*/
@mixin respond($breakpoint) {
    @if $breakpoint == iphone4 {
        @media (max-width: 20em) { @content }; // 320px (iphone4);
    }
    @if $breakpoint == galaxy5 {
        @media (max-width: 360px) { @content}; // 360px (galaxy5);
    }
    @if $breakpoint == iphonex {
        @media (max-width: 375px) { @content}; // 375px (iphonex);
    }
    @if $breakpoint == phone {
        @media (min-width: 48em) { @content }; // 768px (Phone);
    }
    @if $breakpoint == tablet {
        @media (min-width: 64em) { @content }; // 1024px (Tablet);
    }
    @if $breakpoint == desktop {
        @media (min-width: 90em) { @content }; // 1440px (Desktop);
    }
}

